import Manipulators from './Manipulators.js';
import Misc from './Misc.js';
import Style from './Style.js';
import UI from './UI.js';
import Widgets from './Widgets.js';

var Interaction = {
  Manipulators: Manipulators,
  Misc: Misc,
  Style: Style,
  UI: UI,
  Widgets: Widgets
};

export { Interaction as default };
